const samp1 = 10;
const samp2 = 20;

const App=()=> {
  return (
    <div className="App">
      <RegS lname={lvname} fname="Pepito" favenum={samp1} ></RegS>
      <RegS lname="Finn" fname="Mark" favenum="20"></RegS>
    </div>
  );
}

export default App;
